<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>GOSHell Documentation</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="https://unpkg.com/docsify-themeable/dist/css/theme-simple-dark.css">
  <link rel="stylesheet" href="assets/css/main.css">
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
        name: 'GOSHell',
        repo: 'https://github.com/RythenGlyth/gosh',
        loadNavbar: false,
        loadSidebar: true,
        fallbackLanguages: [''],
        alias: {
            '.*?/README.md': 'https://raw.githubusercontent.com/RythenGlyth/gosh/master/README.md',
            '.*?/CHANGELOG.md': 'https://raw.githubusercontent.com/RythenGlyth/gosh/master/CHANGELOG.md'
        },
        homepage: 'https://raw.githubusercontent.com/RythenGlyth/gosh/master/README.md',
        search: 'auto',
        themeColor: '#1e90df',
        plugins: [
        ]
    }
  </script>
  <!-- Docsify v4 -->
  <script src="//cdn.jsdelivr.net/npm/docsify@4"></script>
  <script src="https://unpkg.com/docsify-themeable"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/search.min.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify-pagination/dist/docsify-pagination.min.js"></script>
  <script src="https://unpkg.com/docsify-copy-code@2"></script>
</body>
</html>
